client:
int res[] = statement.executeBatch()
if (res[0] == 200)
{count++;}

client continue insert value , then one node poweroff (or breakpoint), the insert count is inconsistent with query from iotdb

@zhengshubin 是的，目前 LAST 结果集都是以 TEXT 形式返回的。这样做的原因是，目前定义的结果集的每一列必须是相同的类型（实现上的限制），而最新点可能是不同数据类型的。

如果你想获取原始类型的数据，就需要手工转型了：我们最后一列提供了每一个最新点的数据类型，可以根据最后一列进行转型，恢复到原始的数据类型。

当然，你也可以为我们包装一个自带转型功能的 LAST 专用结果集，哈哈 :)
